import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Lol from './components/test.jsx'
import NavBar from './components/navbar.jsx'
import Table from './components/tables2.jsx'
import Search from './components/searchField.jsx'
import DropDown from './components/dropdownFilter.jsx'
import { Tabs, Tab } from 'react-bootstrap'
import './styles/git_stylesheet.css'
import './styles/git_stylesheet2.css'


import 'react-table/react-table.css'
import Issue from './issue';

class App extends Component {
  render() {

    let issues = [];
    issues.push(new Issue("23432", "Sheltine", "2 days ago", "odsnconsc", "2"));
    issues.push(new Issue("2342", "Nyahon", "3 days ago", "aefea", "2"));
    issues.push(new Issue("545645", "coucou", "1 week ago", "wefw", "2"));
    issues.push(new Issue("232345", "lolol", "2 minutes ago", "ergethtehg", "4"));
    issues.push(new Issue("6666666", "Satan", "2000 years ago", "agegaergfaerg", "1"));


    let { title } = this.props;
    return (

      <div className="App">
        <header>

        </header>
        <NavBar/>

        <Tabs defaultActiveKey={2} id="uncontrolled-tab-example">
        <Tab eventKey={1} title="Code"/>
        <Tab eventKey={2} title="Issues">
        <div class="container new-discussion-timeline experiment-repo-nav  ">
        <div class="repository-content ">
          <div class="issues-listing js-check-all-container">
            <DropDown/><Search/>
              <div class="border-right border-bottom border-left" aria-label="Issues" role="group">
                <div class="js-navigation-container js-active-navigation-container">
                  <div class="Box-row Box-row--focus-gray p-0 js-navigation-item js-issue-row read">
                    <div style="border:thin" class="d-table table-fixed width-full Box-row--drag-hide position-relative border-right border-bottom border-left">
                      <div class="float-left col-9 lh-condensed p-2">
                        <a class="link-gray-dark v-align-middle no-underline h4 js-navigation-open">coucou</a>
                      </div>
                    </div>
                  </div>
                  <Table/>
                </div>
              </div>
            </div>
          </div>
        </div>

        </Tab>
        <Tab eventKey={3} title="Pull Requests"/>
        <Tab eventKey={3} title="Projects"/>
        <Tab eventKey={3} title="Insights"/>

      </Tabs>

      </div>
    );
  }
}



export default App;
